var title_f38_2_38955="Indications flu vax adults";
var content_f38_2_38955=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F81840&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F81840&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Summary of seasonal influenza vaccination recommendations for adults, 2009",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td>",
"       Annual vaccination against influenza is recommended for any adult who wants to reduce the risk of becoming ill with influenza or of transmitting it to others. Vaccination is recommended for all adults without contraindications in the following groups, because these persons either are at higher risk for influenza complications, or are close contacts of persons at higher risk:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       &bull; persons aged &ge;50 years",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       &bull; women who will be pregnant during the influenza season",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       &bull; persons who have chronic pulmonary (including asthma), cardiovascular (except hypertension), renal, hepatic, cognitive, neurologic/neuromuscular, hematological or metabolic disorders (including diabetes mellitus)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       &bull; persons who have immunosuppression (including immunosuppression caused by medications or by human immunodeficiency virus)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       &bull; residents of nursing homes and other long-term care facilities",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       &bull; health-care personnel",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       &bull; household contacts and caregivers of children aged &lt;5 years and adults aged &ge;50 years, with particular emphasis on vaccinating contacts of children aged &lt;6 months",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       &bull; household contacts and caregivers of persons with medical conditions that put them at higher risk for severe complications from influenza",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Fiore, AE, Shay, DK, Broder, K, et al. Prevention and control of seasonal influenza with vaccines: recommendations of the Advisory Committee on Immunization Practices (ACIP), 2009. MMWR Recomm Rep 2009; 58:1.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
